window.bookSummaryJSON = "<p>The era of the Tudors was one of danger, intrigue, conspiracy, and, above all, spies. </p> <p>The summer of 1553 is a time of danger and deceit. Brendan Prescott, an orphan, has been reared in the household of the powerful Dudley family. Brought to court, Prescott finds himself sent on an illicit mission to the king’s brilliant but enigmatic sister, Princess Elizabeth. But Brendan is soon compelled to work as a double agent by Elizabeth’s protector, William Cecil, who promises in exchange to help him unravel the secret of his own mysterious past. </p> <p>A dark plot swirls around Elizabeth’s quest to discover the truth about the ominous disappearance of her seriously ill brother, King Edward&nbsp;VI. With only a bold stable boy and an audacious lady-in-waiting at his side, Brendan plunges into a ruthless gambit of half-truths, lies, and murder. </p> <p>Filled with the intrigue and pageantry of Tudor England, <i>The Tudor Secret</i> is the first book in the Elizabeth I Spymaster Chronicles.</p>"; 
